import React, { useState } from 'react';
import axios from 'axios';
import './Main.css';
const Login = () => {
    const [dictName, setDictname] = useState(' ')
    let Authorization = `Bearer ${localStorage.getItem("jwt")}`
    const handleDictname = () => {
        console.log(dictName)
    };
    const handleSubmit = async (event) => {
        event.preventDefault();
        try {
            const response = await axios.post(
                'https://8080-rohlend1-dictionary-dkorwuew5yo.ws-eu98.gitpod.io/auth/login', 
                { Authorization,dictName }
                );
            console.log(response.data);
        } catch (error) {
            console.error('Ошибка при авторизации:', error);
        }
    };

    return (
        <div className="create-form">
        <div className = "block">
        <div className = "title">Создание словаря</div>
        <div className = "center-line">Название:
            <div className = "input">
                <input type="text" onChange={(event)=> {setDictname(event.target.value)}}></input>
                </div>
        </div>
        <div className="line">
        <button className = "button" onClick={handleSubmit} >Создать</button>
        </div>
    </div>
    </div>
    );
};

export default Login;
